public int compareTo(SchedContainerChangeRequest other) {
  if (other == null) {
    return -1;
  }

  int rc = getPriority().compareTo(other.getPriority());
  if (0 != rc) {
    return rc;
  }

  return getContainerId().compareTo(other.getContainerId());
}
